import React, {Component} from 'react';
import "./css/main.css";
import Button from 'react-bootstrap/Button';

class Main extends Component {
    signIn=()=>{
        const nick = this.nickE.value;
        const email = this.emailE.value;
        const company = this.companyE.value;
        const send_param = {
            nick, email, company
        }
        console.log(send_param);
    }
    render(){
        return(
            <div className="container">
                <input placeholder="Nickname" ref={ref=>this.nickE=ref} /><br/>
                <input placeholder="E-mail" ref={ref=>this.emailE=ref} /><br/>
                <input placeholder="Company" ref={ref=>this.companyE=ref}/><br/>
                <input placeholder="Job" /><br/>
                <Button variant="success" onClick={this.signIn}>가입하기</Button>
                <Button variant="warning">다시 생각해보기</Button>
            </div>
        );
    }    
}  

export default Main;
